// About.jsx
import React from "react";
import Slider from "react-slick";
import { FaAws, FaDocker, FaGitAlt, FaJava, FaPython } from "react-icons/fa";
import { SiGrafana, SiMongodb, SiBlazor, SiReact, SiUnity, SiKubernetes, SiC } from "react-icons/si";
import { GiCube } from "react-icons/gi";
import { TbBrandSupabase } from "react-icons/tb";
import { MdOutlineScience } from "react-icons/md";
import { ReactComponent as PlaywrightIcon } from "../img/playwright.svg";
import myImage from "../img/myImage.png";
import "./About.css";

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

class About extends React.Component {
  constructor() {
    super();
    this.sliderRef = React.createRef();

    this.state = {
      skills: [
        { name: "AWS", icon: <FaAws color="#FF9900" />, bg: "linear-gradient(135deg,#232f3e,#ff9900)" },
        { name: "Git/GitHub", icon: <FaGitAlt color="#F05032" />, bg: "linear-gradient(135deg,#24292e,#f05032)" },
        { name: "Docker", icon: <FaDocker color="#2496ED" />, bg: "linear-gradient(135deg,#0db7ed,#fff)" },
        { name: "Kubernetes", icon: <SiKubernetes color="#326CE5" />, bg: "linear-gradient(135deg,#172b4d,#326CE5)" },
        { name: "Playwright", icon: <PlaywrightIcon color="#2EAD33" />, bg: "linear-gradient(135deg,#000,#2ead33)" },
        // add other skills...
      ],
    };
  }

  handleFlipStart = () => {
    if (this.sliderRef.current) {
      this.sliderRef.current.slickPause();
    }
  };

  handleFlipEnd = () => {
    if (this.sliderRef.current) {
      this.sliderRef.current.slickPlay();
    }
  };

  render() {
    const settings = {
      infinite: true,
      autoplay: true,
      autoplaySpeed: 1,
      speed: 8000,
      cssEase: "linear",
      slidesToShow: 5,
      slidesToScroll: 1,
      arrows: false,
      pauseOnHover: false,
      draggable: true,
      responsive: [
        { breakpoint: 1200, settings: { slidesToShow: 4 } },
        { breakpoint: 768, settings: { slidesToShow: 2 } },
        { breakpoint: 480, settings: { slidesToShow: 1 } },
      ],
    };

    return (
      <section id="about" className="about-mf sect-pt4 route">
        <div className="container-fluid">
          <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full modern-card">
                <div className="row">
                  <div className="col-md-5 text-center">
                    <img src={myImage} alt="Profile" className="img-fluid rounded-circle shadow-lg profile-img" />
                  </div>

                  <div className="col-md-7">
                    <div className="about-me pt-4 pt-md-0">
                      <h3 className="title-left mb-3">About Me</h3>
                      <p className="lead text-muted">
                        I’m Kavinraj S.K, a Computer Science undergraduate with strong foundations in Cloud, DevOps, and Full Stack Development.
                      </p>
                    </div>

                    <div className="skills-showcase mt-5">
                      <h5 className="title-s mb-3">Skills</h5>
                      <Slider ref={this.sliderRef} {...settings} className="skills-slider">
                        {this.state.skills.map((skill, idx) => (
                          <div key={idx} className="skill-slide">
                            <div
                              className="skill-flip"
                              style={{ background: skill.bg }}
                              onMouseEnter={this.handleFlipStart}
                              onMouseLeave={this.handleFlipEnd}
                            >
                              <div className="skill-front">{skill.icon}</div>
                              <div className="skill-back">{skill.name}</div>
                            </div>
                          </div>
                        ))}
                      </Slider>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default About;
